;;   ?term_name_field obo:IAO_0000219 ?term_name .
    
;; }
;; GROUP BY ?eg_ice
;; @@

;; @@
(defquery kevin []

  (select :eg_ice (group_concat :term_name "|" :nbo_term_names))

  (where-

   (values :eg_ice gene-list)
   
   :eg_ice iao:denotes :gene 							; the EG ID denotes a kabob gene
   (in-taxon Human :gene) 							 	; retrieve the taxonomy identifier for the gene just to make sure it is human (9606)
   (with-homolog :gene :homologous_mouse_gene Mouse) 	; retrieve any homologous mouse genes (taxon=10090)
   (with-NBO-term :homologous_mouse_gene :term_name) 	; now look for NBO annotation ICE records that link mouse genes to NBO concepts
   )
  (group-by :eg_ice)
  )
